import "./App.css";
import React from "react";
import {Button, Checkbox, Container, Form} from "semantic-ui-react";
import FeedbackForm from "./components/feedback-component/FeedbackForm";
import UserForm from "./components/user-component/UserForm";



function App() {

  openFeedback = () => {
    return <FeedbackForm name="test" />
  }

  return (
    <Container className='main-container'>
      <UserForm />
    </Container>
  );
}

export default App;
